import { IoIosPhonePortrait } from "react-icons/io";
import { CgWebsite } from "react-icons/cg";
import { MdAddBusiness } from "react-icons/md";
import { FcAdvertising } from "react-icons/fc";

const Services = () => {
  return (
    <div className="mt-10 sm:mt-20 bg-primary-light dark:bg-ternary-dark shadow-sm">
      <div className="font-general-medium container mx-auto py-20 block sm:flex sm:justify-between items-center">
        <div style={{ justifyContent: "center", alignItems: "center" }}>
          <h1 style={{ textAlign: "center" }}>Our Services</h1>
          <h3 style={{ textAlign: "center" }}>
            We Help You To Build High-Quality Digital Solutions And Products As
            Well As Deliver A Wide Range Of Related Professional Services. We
            Are Providing World-Class Service To Our Clients.
          </h3>
        </div>
        <div
          className="direction"
          style={{
            display: "flex",
            flexDirection: "column", // Corrected typo: coloum -> column
            justifyContent: "space-between",
            alignItems: "center",
            marginTop: 20,
          }}
        >
          <div
            className="item"
            style={{
              textAlign: "center",
              borderRadius: 7,
              boxShadow: 2,
              paddingTop: 50,
              padding: 30,
            }}
          >
            <IoIosPhonePortrait size={45} />
            <h3>Application Development</h3>
          </div>
          <div
            className="item"
            style={{
              textAlign: "center",
              borderRadius: 7,
              boxShadow: 2,
              paddingTop: 50,
              padding: 30,
            }}
          >
            <CgWebsite size={45} />
            <h3>Web Application </h3>
          </div>
          <div
            className="item"
            style={{
              textAlign: "center",
              borderRadius: 7,
              boxShadow: 2,
              paddingTop: 50,
              padding: 30,
            }}
          >
            <MdAddBusiness size={45} />
            <h3>E-Commerce & Business Consultant</h3>
          </div>
          <div
            className="item"
            style={{
              textAlign: "center",
              borderRadius: 7,
              boxShadow: 2,
              paddingTop: 50,
              padding: 30,
            }}
          >
            <FcAdvertising size={45} />
            <h3>Digital Marketing</h3>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Services;
